import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={styles.container}>
      <div style={styles.hero}>
        <h1 style={styles.title}>Something Vague</h1>
        <p style={styles.subtitle}>Discover amazing music from around the world</p>

        <div style={styles.ctaContainer}>
          <Link to="/player" style={styles.primaryButton}>
            Tune In
          </Link>
        </div>

        <div style={styles.nowPlaying}>
          <p style={styles.nowPlayingText}>Now on air:</p>
          <h3 style={styles.currentTrack}>Artist - Track Title</h3>
          <p style={styles.genre}>Experimental Ambient</p>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    backgroundColor: '#ffffff',
    minHeight: '100vh',
    padding: '0 2rem',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
  },
  hero: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    textAlign: 'center',
    maxWidth: '600px',
    margin: '0 auto',
  },
  title: {
    fontSize: '3rem',
    fontWeight: '300',
    color: '#333',
    marginBottom: '0.5rem',
    letterSpacing: '1px',
  },
  subtitle: {
    fontSize: '1.1rem',
    color: '#666',
    marginBottom: '3rem',
    lineHeight: '1.6',
    fontWeight: '300',
  },
  ctaContainer: {
    margin: '2rem 0 3rem',
  },
  primaryButton: {
    backgroundColor: '#000',
    color: '#fff',
    padding: '1rem 3rem',
    borderRadius: '0',
    textDecoration: 'none',
    fontWeight: '400',
    letterSpacing: '1px',
    fontSize: '1rem',
    transition: 'all 0.2s ease',
    display: 'inline-block',
  },
  nowPlaying: {
    marginTop: '3rem',
    padding: '1.5rem 2rem',
    borderTop: '1px solid #eee',
    borderBottom: '1px solid #eee',
  },
  nowPlayingText: {
    color: '#999',
    fontSize: '0.9rem',
    marginBottom: '0.5rem',
    letterSpacing: '1px',
  },
  currentTrack: {
    fontSize: '1.2rem',
    fontWeight: '400',
    color: '#333',
    margin: '0 0 0.25rem 0',
  },
  genre: {
    color: '#999',
    fontSize: '0.9rem',
    margin: 0,
    fontStyle: 'italic',
  },
};

// Add these hover effects to your CSS:
// .primaryButton:hover {
//   background-color: #333;
// }

export default Home;
